import React from 'react';

class ProfileIcon extends React.Component {
   constructor(props){
   	super(props);
   	this.state={
   		dropdownOpen: false
   	}
   }
   render(){
   	return(
   		<div class="pa4 tc">
  <img
      src="http://tachyons.io/img/logo.jpg"
      class="h3 w3 dib" alt="avatar"/>
   </div>

   	)
  }
}



export default ProfileIcon;
